    false,nt"url": null,nt"notes": "NCEI Accession 0153500 includes physical
    and underway data collected aboard the ROBERT GORDON SPROUL during cruise SP1408
    in the North Pacific Ocean on 2014-11-02. These data include CURRENT SPEED - EAST/WEST
    COMPONENT (U) and CURRENT SPEED - NORTH/SOUTH COMPONENT (V). The instruments used
    to collect these data include ADCP and GPS. These data were collected by David Checkley
    of University of California - San Diego; Scripps Institution of Oceanography as
    part of Biological Oceanography Student Cruise. The Lamont-Doherty Earth Observatory
    (LDEO) submitted these data to NCEI as part of the NSF sponsored Rolling Deck to
    Repository (R2R) program.nnThe ADCP data represent the raw and automated processed
